import React from 'react'

function Form() {
  return (
    <div>
        <div><input name='fullName' placeholder='Full Name'></input></div>
        <div><input name='phone_number' placeholder='Phone Number'></input></div>
        <div><button >Add</button></div>
      
      
      <button></button>
    </div>
  )
}

export default Form;
